import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import DataEntry from './components/DataEntry';
import BalancePlanning from './components/BalancePlanning';
import Simulations from './components/Simulations';
import CultivoDetail from './components/CultivoDetail';

function App() {
  return (
    <Router>
      <div className="App">
        <nav>
          <ul>
            <li><Link to="/">Carga de Datos</Link></li>
            <li><Link to="/balance">Balance y Planificaci√≥n</Link></li>
            <li><Link to="/simulaciones">Simulaciones</Link></li>
            <li><Link to="/CultivoDetail">Detalle de cultivo</Link></li>

          </ul>
        </nav>

        <Routes>
          <Route path="/" element={<DataEntry />} />
          <Route path="/cultivo/:id" element={<CultivoDetail />} />
          <Route path="/balance" element={<BalancePlanning />} />
          <Route path="/simulaciones" element={<Simulations />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
